import './App.css';
import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom'; // Importa BrowserRouter y Route
import Formlogin from './Login/form_login';
import Formregister from './Login/form_register';
function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/register" component={Formregister} /> {/* Ruta para el formulario de registro */}
        <Route path="/login" component={Formlogin} /> {/* Ruta para el formulario de login */}
        
        {/* Otras rutas de tu aplicaci√≥n */}
      </Switch>
    </BrowserRouter>
  );
}

export default App;
